using System;
using System.Collections.Generic;
using System.Linq;
using System.Reflection;
using System.Text;
using System.Threading.Tasks;
using System.Windows.Media.Media3D;

namespace SmartScanUI.Scanner.CZUR
{
    public class CzurEngine
    {

        private AxCZUROcxLib.AxCZUROcx axCZUROcx1;
        public CzurEngine(AxCZUROcxLib.AxCZUROcx ScannerControl)
        {
            axCZUROcx1 = ScannerControl;
        }

        public string GetLicenseInfo()
        {
            return "";
        }

        public string Initialize()
        {
            string strLicense = GetLicenseInfo();
            var status = (CzurInitializationStatus)axCZUROcx1.CZUR_Initialize(strLicense);
            if (status == CzurInitializationStatus.Success || status==CzurInitializationStatus.AlreadyInitialized)
            {
                return String.Empty;
            }
            else
            {
                return $"Initialization failed with status: {status}";
            }
        }

        public string Uninitialize()
        {
            try
            {
                axCZUROcx1.CZUR_Deinitialize();
                return String.Empty;
            }
            catch (Exception ex)
            {
                return ex.Message;
            }
        }
        /// <summary>
        /// Open Device with specified index and resolution. HP and VP are the horizontal and vertical pixels per inch, respectively. The default values are 300 for both, which is a common resolution for scanning documents. Adjusting these values can affect the quality and file size of the scanned images.
        /// </summary>
        /// <param name="index">0 (main camera), 1 (secondary camera)</param>
        /// <param name="width">x resolution of camera </param>
        /// <param name="height">y resolution of camera </param>
        /// <param name="hp">The horizontal percentage of display area of secondary camera by the CZUROcx window, 1~100 </param>
        /// <param name="vp">he vertical percentage of display area of secondary camera by the CZUROcx window, 1~100 </param>
        /// <returns>status of the Opendevice form enum-CzurOpenDeviceStatus</returns>
        public string OpenDevice(int index, int width, int height,int hp,int vp)
        {
            var status = (CzurOpenDeviceStatus)axCZUROcx1.CZUR_OpenDevice(index, width, height, hp, vp);
            return status == CzurOpenDeviceStatus.Success ? String.Empty : $"Failed to open device with status: {status}";
        }

        public string CloseDevice(int index)
        {
            var status = (CzurCloseDeviceStatus)axCZUROcx1.CZUR_CloseDevice(index);
            return status == CzurCloseDeviceStatus.Success ? String.Empty : $"Failed to close device with status: {status}";
        }

        public string SetProcessType(int type)
        {
            var status = (CzurSetProcessTypeStatus)axCZUROcx1.CZUR_SetProcessType(type);
            return status == CzurSetProcessTypeStatus.Success ? String.Empty : $"Failed to Set Process Type: {status}";
        }

        public string GetDeviceModel()
        {
            var deviceModel =axCZUROcx1.CZUR_GetDeviceModel();
            return deviceModel;
        }

        public string GetDeviceId()
        {
            var deviceId=axCZUROcx1.CZUR_GetDeviceID();
            return deviceId;
        }


    }
}
